import { gql } from '@apollo/client';

export const GET_POSTS = gql`
  query GetPosts {
    posts {
      nodes {
        id
        title
        content
        slug
      }
    }
  }
`;

export const GET_HEADER_SETTINGS = gql`
query HeaderSettings {
  themeSettings {
    themeSettingsFields {
      navigation {
        fieldGroupName
        buttons {
          fieldGroupName
          label
          url
        }
        logo {
          node {
            sourceUrl
          }
        }
      }
    }
    id
  }
}`;

export const GET_HEADER_MENU = gql`
query HeaderMenu($location: location!) {
  menuItems(where: {location: $location}) {
    edges {
      node {
        cssClasses
        target
        uri
        parentId
        childItems {
          nodes {
            label
          }
        }
        label
      }
    }
  }
}`;
